import React from "react";
import "./styles.css";

export const Navbar = () => {
  return (
    <div className="frame">
      <div className="div">
        <div className="text-wrapper">ABOUT</div>
        <div className="text-wrapper">PLAYGROUND</div>
      </div>
      <div className="div-wrapper">
        <div className="text-wrapper-2">KN</div>
      </div>
      <div className="div">
        <div className="text-wrapper">PORTFOLIO</div>
        <div className="text-wrapper">RESUME</div>
      </div>
    </div>
  );
};
